import axios from "axios";
import { api } from "../../../config";


export class API {
    constructor() {
      this.host = api.base_url;
    }

    getTriggerTimes = function (request) {
      return axios({
        url: `${this.host}/cron/triggerTimes`,
        headers: {
          Accept: "application/json",
          "Content-Type": "application/json",
          "Access-Control-Allow-Origin":"*",
        },
        method: "POST",
        data: JSON.stringify({
          cron: request
        }),
      });
    };

    getRequest = function () {
        return axios({
          url: `${this.host}/validateCron`,
          headers: {
            Accept: "application/json",
            "Content-Type": "application/json",
          },
          method: "GET",
        });
      };
}
